aq_reason_1_first_label:"O Warren é uma Gestora e Administradora credenciada e fiscalizada pela Comissão de Valores Mobiliários (CVM), que é o xerifão do mercado financeiro.",dash_start_register_faq_reason_1_second_label:"Além disso, o Warren é aderente a Anbima e precisa manter auditoria externa e todo o processo de controles internos e compliance, assim como os grandes Bancos que você já conhece, por exemplo.",dash_start_register_faq_reason_2_header:"2. Para onde vai o seu dinheiro",dash_start_register_faq_reason_2_first_label:"O seu dinheiro é investido, através dos Fundos de Investimento do Warren, nos produtos financeiros sugeridos quando você constrói sua Carteira. Todos os produtos ficam sob a custódia do Santander, nosso banco custodiante.",dash_start_register_faq_reason_3_header:"3. Quem somos",dash_start_register_faq_reason_3_first_label:"A turma que está fazendo o dia a dia do Warren tem uma bagagem bem grande de mercado financeiro, tanto no Brasil quanto nos EUA.",dash_start_register_faq_reason_3_second_label:"Dentre eles estão o co-fundador e ex-sócios da maior corretora do Brasil, PhD em economia, ex-professores da Universidade de Utah, UFRJ e UFRGS, o fundador de uma das maiores gestoras do país, o maior especialista em plataformas de trading para bolsa, UXDesigner de uma das maiores agencias dos EUA, além de toda uma equipe bacana de desenvolvedores, backoffice e customer service.",dash_start_register_faq_reason_4_header:"4. Por que o Warren e não um banco ou corretora?",dash_start_register_faq_reason_4_first_label:"Investir através de Bancos ou Corretoras pode ser complicado e cheio de armadilhas.",dash_start_register_faq_reason_4_second_label:"No Warren não existe o conflito de interesse da indústria tradicional e a experiência de investir além de ser simples e transparente, conta com todo o trabalho operacional do Warren.",dash_start_register_faq_reason_4_third_label:"Ele monta portfólios inteligentes e filtra os melhores produtos para cada portfólio, executa as operações em bolsa, cuida de vencimentos, rebalanceamentos, reinveste pagamentos de juros e dividendos.",dash_start_register_faq_reason_5_header:"5. Quanto custa investir?",dash_start_register_faq_reason_5_first_label:"O valor é 0,5%% ao ano, o que é em média 3 vezes mais barato que bancos e corretoras. Neste valor está gestão, administração, distribuição, auditoria, custódia, entre outros. A cobrança é feita em cima do valor investido e o cálculo é um pró-rata debitado no quinto dia útil referente ao mês anterior ou quando você realiza um saque.",dash_start_register_faq_reason_5_second_label:"Todo o processo é automatizado. Das rotinas de back office ao CRM, e do cadastro a construção de portfólios de investimento. Com isso, o Warren consegue atender com a mesma eficiência e custos baixos 50 ou 100 milhões de clientes. O resultado disso? Uma enorme economia que é repassada para você :)",dash_start_register_faq_reason_5_third_label:"O Warren atrai clientes oferecendo um melhor serviço, enquanto Bancos e Corretoras atraem clientes com propagandas bonitas, escritórios suntuosos e pisos de mármore.",dash_start_register_faq_reason_6_header:"6. E se eu quiser resgatar?",dash_start_register_faq_reason_6_first_label:"Você pode resgatar quando quiser, não existe tempo mínimo de carência nem nada do tipo.",dash_start_register_faq_reason_6_second_label:"É só entrar na sua área logada, escolher sua carteira e resgatar. Se a carteira tiver um portfólio com 100%% renda fixa, solicitando o resgate até as 12:00 o dinheiro cai na sua conta no dia seguinte.",dash_start_register_faq_reason_6_third_label:"Em um portfólio que tem ações o dinheiro demora três dias para cair na conta, devido ao fluxo da bolsa.",dash_start_register_faq_reason_7_header:"7. Pago alguma coisa para abrir uma conta?",dash_start_register_faq_reason_7_first_label:"Não. Abrir uma conta no Warren é 100%% grátis, assim como manter a conta aberta. Você só paga quando começa a investir.",dash_start_register_faq_first_final_label:"Agora você está preparado.",dash_start_register_faq_second_final_label:"Faça parte de uma nova geração de investidores!",dash_start_register_faq_start_register:"Começar cadastro!",dash_start_register_faq_final_label:"Fácil, rápido e 100%% digital.",dash_loading_welcome:"Oi, %s",dash_loading_welcome_noname:"Olá, como você está? =)",dash_loading_firsttime:"Conheça a sua área logada!",dash_label_balance:"Saldo R$",dash_label_earnings:"Rendendo R$",dash_label_achieved:"Concluído",dash_label_newgoal:"Novo carteira",dash_label_group_members:"Participantes",dash_button_details:"Detalhes",dash_button_newgoal:"Criar nova carteira",dash_button_rate_app:"Logout",dash_button_feedback:"Enviar sugestão/crítica",dash_button_logout:"Licenças",dash_button_investing:"Investir",dash_balance_available_label_balance_to_invest:"Saldo disponível para investir",dash_balance_available_label_invest_after:"Investir depois",dash_balance_available_label_invest:"Investir",dash_portfolio_group_invitation_label_received_invitation:"Convite",dash_portfolio_group_invitation_label_shared_objective:"%s te convidou para participar de uma carteira compartilhado!",dash_portfolio_group_invitation_label_decline_invitation:"Recusar convite",dash_portfolio_group_invitation_label_see_invitation:"Ver convite",portfolio_update_time:"Valor estimado sem descontar IR e IOF (custo Warren já deduzido).",investment_account_update_time:"Valor estimado sem descontar IR e IOF.",portfolio_update_time_netbalance:"Valor estimado descontando IR e IOF (custo Warren já deduzido).",investment_account_update_time_netbalance:"Valor estimado descontando IR e IOF.",portfolio_update_time_noupdate:"Atualizado todo dia útil às 13h e 17h.",portfolio_update_time_updateat:"Última atualização %s.",dash_context_startinvesting_title:"Você já pode investir!",dash_context_startinvesting_subtitle:"Clique no botão para fazer seu primeiro depósito",dash_context_startinvesting_button:"Investir",dash_context_finishin