t_mm1_explanation:"Este portfólio investe em ações, o que tende a trazer mais performance, porém um pouco mais de risco.",portfolio_chart_mm2_explanation:"Este portfólio investe em ações, o que tende a trazer mais performance, porém também traz mais risco. Podem ocorrer variações positivas e negativas que são normais no curto prazo, então é um portfólio a ser pensado para médio e longo prazo.",portfolio_chart_mm3_explanation:"Este portfólio investe em ações, o que tende a trazer mais performance no longo prazo, mas no curto prazo podem acontecer variações positivas e negativas. Esse sobe e desce é natural. Siga a estratégia pensando no longo prazo.",portfolio_chart_mm4_explanation:"Este portfólio investe em ações, o que tende a trazer uma excelente performance no longo prazo, mas no curto prazo podem acontecer grandes variações positivas e negativas. Esse sobe e desce é natural, por isso não fique eufórico quando os preços subirem demais, nem ansioso quando os preços caírem, isso vai acontecer muitas vezes. Siga a estratégia e pense no longo prazo.",portfolio_context_portfolio_virtual:"Valores simulados",portfolio_context_goal_summary_title:"Resumo",portfolio_context_goal_investment_title:"Sua Conta",portfolio_context_goal_summary_goal_percentage_label:"Concluído",portfolio_context_goal_summary_goal_financial_label:"Concluído",portfolio_context_goal_summary_goal_ontrack:"Sua carteira",portfolio_context_goal_summary_goal_offtrack:"Sua carteira",portfolio_context_goal_summary_goal_ontrack_snippet:"Dentro da carteira",portfolio_context_goal_summary_goal_offtrack_snippet:"Fora da carteira",portfolio_context_goal_summary_goal_group_objective_ontrack:"Carteira do grupo",portfolio_context_goal_summary_goal_group_objective_offtrack:"Carteira do grupo",portfolio_context_goal_performance_history_title:"Histórico",portfolio_context_goal_performance_history_empty:"Não há histórico de performance",portfolio_context_goal_performance_history_month_title:"Mês",portfolio_context_goal_performance_history_year_title:"Consolidado do ano",portfolio_context_goal_performance_history_your_portfolio:"Sua carteira",portfolio_context_goal_summary_returns_percentage_period:"Performance desde o início",portfolio_context_goal_summary_returns_financial_period:"Rendimento desde o início",portfolio_context_goal_summary_returns_percentage_period_tooltip:"Este valor %% mede a performance que o seu portfólio teve desde quando você começou a investir nele. O resultado não leva em conta seus depósitos e resgates. Por isso, o valor pode ser diferente do rendimento R$.",portfolio_context_goal_summary_returns_financial_period_tooltip:"Este valor é o resultado bruto que você tem acumulado desde quando você começou a investir nesta carteira e leva em conta depósitos e resgates. Por isso, o valor pode ser diferente da performance %%.",portfolio_context_goal_summary_income_tax_title:"IR",portfolio_context_goal_summary_income_tax_description:"O Imposto de Renda incide somente sobre os rendimentos. Em alguns produtos, como fundos de renda fixa e multimercado, quanto mais tempo seus investimentos ficarem aplicados, menor é a alíquota. Dependendo dos produtos aplicados, o IR é cobrado automaticamente quando você resgata, ou no “come-cotas”.",portfolio_context_goal_summary_transaction_tax_title:"IOF",portfolio_context_goal_summary_transaction_tax_description:"O IOF é o imposto que existe nos primeiros 30 dias de cada aporte. A alíquota varia de acordo com o número de dias que o dinheiro permanecer aplicado, indo de 96%% a 0%% sobre o total dos rendimentos do aporte. Ou seja, se você não resgatar durante 30 dias, esse imposto zera.",portfolio_context_goal_perproduct_title:"Por produto",portfolio_context_goal_perproduct_category1:"Renda Fixa",portfolio_context_goal_perproduct_category2:"Ações",portfolio_context_goal_history_placeholder_label_pending:"Pendentes",portfolio_context_goal_history_placeholder_label_invest:"Investir",portfolio_context_goal_history_placeholder_label_has_no_transactions:"Não há transações pendentes",portfolio_context_goal_history_placeholder_label_has_no_transactions_done:"Não há transações realizadas",portfolio_context_goal_history_placeholder_label_realized:"Realizados",portfolio_context_goal_history_ongoing_label_pending:"Pendentes",portfolio_context_goal_history_ongoing_label_invest:"Investir",portfolio_context_goal_history_ongoing_label_rescue:"Resgatar",portfolio_context_goal_history_ongoing_table_head_date:"Data",portfolio_context_goal_history_ongoing_table_head_movement:"Movimentação",portfolio_context_goal_history_ongoing_table_head_status:"Status",portfolio_context_goal_history_ongoing_table_head_value:"Valor",portfolio_context_goal_history_label_dones:"Realizados",portfolio_context_goal_history_label_invest:"Investir",portfolio_context_goal_history_label_rescue:"Resgatar",portfolio_context_goal_history_table_head_date:"Data",portfolio_context_goal_history_table_head_movement:"Movimentação",portfolio_context_goal_history_table_head_status:"Status",portfolio_context_goal_history_table_head_value:"Valor",portfolio_context_goal_history_faq_title:"Dúvidas",portfolio_context_goal_faq_question_1:"Quanto tempo leva para meu depósito/boleto ser investido?",portfolio_context_goal_faq_question_1_title_1:"Depósitos feitos antes das 13h:",portfolio_context_goal_faq_question_1_answer_1:"No mesmo dia (se for dia útil), o Warren irá processar seu depósito das 13h às 18h, e seu dinheiro será investido. Às 18h, você poderá ver a posição oficial na sua carteira.",portfolio_context_goal_faq_question_1_title_2:"Depósitos feitos depois das 13h:",portfolio_context_goal_faq_question_1_answer_2:"No dia útil seguinte ao seu depósito, o Warren irá processá-lo das 13h às 18h e seu dinheiro será investido. Às 18h do dia útil seguinte, você poderá ver a posição oficial na sua carteira.",portfolio_context_goal_faq_question_2:"Quanto tempo leva para um resgate cair na minha conta bancária?",portfolio_context_goal_faq_question_2_title_1:"Resgates feitos antes das 13h:",portfolio_context_goal_faq_question_2_answer_1:"São processados no mesmo dia (se for útil) e levam até 1 dia útil para carteiras 100%% renda fixa e até 3 dias úteis para carteiras que têm ações. Depois, são transferidos para sua conta bancária.",portfolio_context_goal_faq_question_2_title_2:"Resgates feitos depois das 13h:",portfolio_context_goal_faq_question_2_answer_2:"São processados no dia útil seguinte e levam mais 1 dia útil para carteiras 100%% renda fixa e até 3 dias úteis para carteiras que têm ações e então são transferidos para sua conta bancária.",portfolio_context_goal_faq_question_3:"Posso resgatar quando quiser?",portfolio_context_goal_faq_question_3_answer_1:"Sim. O dinheiro é seu e o controle sobre ele é seu também. Você pode resgatar dinheiro da sua carteira quando quiser, sem penalidades ou multas.",portfolio_context_goal_faq_question_4:"Tenho que investir todo mês?",portfolio_context_goal_faq_question_4_answer_1:"Não. O planejamento que você fez é um guia de como alcançar sua carteira, mas você pode investir valores diferentes como e quando quiser. Se você não puder investir em algum momento, não tem problema.",portfolio_transaction_status_deposit_title1:"Depósito via transferência",portfolio_transaction_status_deposit_requested_step1_title:"Solicitado",portfolio_transaction_status_deposit_requested_step2_title:"Aguardando transferência",portfolio_transaction_status_deposit_requested_step2_description:"Será investido em até 2 dias úteis, após feita a transferência",portfolio_transaction_status_deposit_requested_step3_title:"Realizado",portfolio_transaction_status_deposit_processing_step2_title:"Finalizando",portfolio_transaction_status_deposit_processing_step2_description:"Comprando ativos…",portfolio_transaction_status_deposit_title:"A investir",portfolio_transaction_status_deposit_title_dda:"Solicitação",portfolio_transaction_status_deposit_title2:"Dados para depósito",portfolio_transaction_status_deposit_titl